  [],\n\t\"revision_timestamp\": \"2016-07-27T22:21:14.516916\",\n\t\"name\": \"watsonville-sloughs-watershed-resource-conservation-and-enhancement-plan\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This document identifies feasible projects
  that address the long-term protection and enhancement of the Watsonville Sloughs
  systemu2019s ecological values and the needs of agriculture and other land uses.
  The Watsonville Sloughs Watershed Conservation and Enhancement Plan (WSCEP) specifies
  feasible measures that address the long-term protection and enhancement of the Watsonville
  Sloughs systemu2019s ecological values, and the needs of agriculture and other land
  uses. The WSCEP is designed to provide a future vision and a guide for many agencies,
  organizations and individual landowners. It is anticipated that the various entities
  will embark on a coordinated effort to implement the Plan and focus on priority
  areas. The Plan is based upon scientific, social and economic factors that have
  often worked at odds, but must be realigned if successful preservation and enhancement
  of the landscape and rural character of the Sloughs is to be realized. Most of the
  resource management activity now occurs in the regulatory sector, leading to a fragmented
  and often contentious relationship between stewardship organizations seeking resource
  protection and landowners. A key aim of the Plan is to find resource solutions that
  foster cooperation between various groups, agencies and landowners. The Plan is
  designed to be adaptable and flexible should important factors change in the future.
  Participation is on a strictly voluntary basis.\",\n\t\"license_title\": \"License
